import { useEffect, useState } from "react";

function useFetch(url) {
    let [data, setData] = useState(null);
    let [error, setError] = useState(null)

    useEffect(() => {
fetch(url)
.then()
    }, [url])

    return [data, error]
}

export default useFetch;
